import React from 'react';

const AccountingTransactions = () => (
  <div>
    <h2>Transactions</h2>
    <ul>
      <li>Invoice: $1000</li>
      <li>Expense: -$200</li>
    </ul>
  </div>
);

export default AccountingTransactions;
